--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_UpdateDetailCombo (IN m_ComboId char(36),
IN m_InventoryItemId char(36),
IN m_Quantity int(11),
IN m_Part int(11),
IN m_IsUse tinyint(1),
IN m_CreatedDate datetime,
IN m_CreatedBy varchar(255),
IN m_ModifiedDate datetime,
IN m_ModifiedBy varchar(255))
BEGIN
  UPDATE detailcombo d
  SET d.Quantity = m_Quantity,
      d.Part = m_Part,
      d.IsUse = m_IsUse,
      d.CreatedDate = m_CreatedDate,
      d.CreatedBy = m_CreatedBy,
      d.ModifiedDate = m_ModifiedDate,
      d.ModifiedBy = m_ModifiedBy
