--
-- Create procedure `Proc_GetDetailCombos`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_GetDetailCombos (IN m_ComboID char(36), IN m_InventoryItemID char(36))
BEGIN
  IF m_InventoryItemID IS NOT NULL
    AND m_ComboID IS NOT NULL THEN
    SELECT
      *
    FROM detailcombo d
    WHERE d.InventoryItemId = m_InventoryItemID
    AND d.ComboId = m_ComboID;
  ELSEIF m_InventoryItemID IS NOT NULL THEN
    SELECT
      *
    FROM detailcombo d
    WHERE d.InventoryItemId = m_InventoryItemID;
  ELSEIF m_ComboID IS NOT NULL THEN
    SELECT
      *
    FROM detailcombo d
    WHERE d.ComboId = m_ComboID;
  END IF;
END
$$

--
-- Create procedure `Proc_DeleteDetailCombo`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_DeleteDetailCombo (IN m_ComboID char(36), IN m_InventoryItemID char(36))
BEGIN
  IF m_InventoryItemID IS NOT NULL
    AND m_ComboID IS NOT NULL THEN
    DELETE
      FROM detailcombo
    WHERE InventoryItemId = m_InventoryItemID
      AND ComboId = m_ComboID;
  ELSEIF m_InventoryItemID IS NOT NULL THEN
    DELETE
      FROM detailcombo
    WHERE InventoryItemId = m_InventoryItemID;
  ELSEIF m_ComboID IS NOT NULL THEN
    DELETE
      FROM detailcombo
    WHERE ComboId = m_ComboID;
  END IF;
END
$$

